pragma solidity ^0.4.18;

contract MyContract {
    string public name;
    string public symbol;
    uint8 public decimals;
    string public standard;
    uint256 public totalsupply;
    uint256 public tokenprice;
    uint256 public redeemprice;
    uint256 public lasttxblocknum;
    mapping(address => uint256) public balanceof;
    mapping(address => mapping(address => uint256)) public allowance;

    function MyContract() public payable {
        if (msg.value == 0) {
            decimals = 15;
            totalsupply = 0;
            tokenprice = 0x5f5e100;
            symbol = '0';
            name = '0';
            standard = '0';
        }
    }

    function approve(address _spender, uint256 _value) public returns(bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function() public payable {
        if (msg.value >= 0x2540be400) {
            lasttxblocknum = block.number;
            if (tokenprice != 0) {
                balanceof[msg.sender] += (msg.value / tokenprice) * 0x3b9aca00;
                totalsupply += (msg.value / tokenprice) * 0x3b9aca00;
                if (totalsupply != 0) {
                    redeemprice = (((this.balance * 0x3b9aca00) / totalsupply) * 900) / 1000;
                    tokenprice = (((this.balance * 0x3b9aca00) / totalsupply) * 1100) / 1000;
                }
            }
        }
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns(bool success) {
        require(balanceof[_from] >= _value && balanceof[_to] + _value >= balanceof[_to] && _value <= allowance[_from][msg.sender]);
        balanceof[_from] -= _value;
        balanceof[_to] += _value;
        allowance[_from][msg.sender] -= _value;
        return true;
    }

    function transfer(address _to, uint256 _value) public returns(bool success) {
        require(balanceof[msg.sender] >= _value && balanceof[_to] + _value >= balanceof[_to]);
        balanceof[msg.sender] -= _value;
        if (_to != address(this)) {
            balanceof[_to] += _value;
        } else {
            totalsupply -= _value;
            if (totalsupply == 0) {
                redeemprice = 0;
                tokenprice = 0x5f5e100;
            }
            if (lasttxblocknum >= block.number - 5000) {
                msg.sender.transfer((_value * redeemprice) / 0x3b9aca00);
                if (totalsupply != 0) {
                    tokenprice = (((this.balance * 0x3b9aca00) / totalsupply) * 1100) / 1000;
                    redeemprice = (((this.balance * 0x3b9aca00) / totalsupply) * 900) / 1000;
                }
            } else {
                msg.sender.transfer((_value * (this.balance * 0x3b9aca00) / totalsupply) / 0x3b9aca00);
                if (totalsupply != 0) {
                    redeemprice = (((this.balance * 0x3b9aca00) / totalsupply) * 900) / 1000;
                    tokenprice = (((this.balance * 0x3b9aca00) / totalsupply) * 1100) / 1000;
                }
            }
        }
        return true;
    }
}
